import { delItem } from "../js/actions/index";
import { connect } from 'net';
function mapDispatchToProps(dispatch) {
    return {
      delItem: index => dispatch(delItem(index))
    };
  }

class Comp1 extends Component {
    deleteitem(e) {
        this.props.delItem(e);
      }
    render() { 
        return ( 
            console.log(this.props.val),
            <div className='List' onClick={this.deleteitem}>{this.props.val}</div>
         );
    }
}

const Comp= connect(null,mapDispatchToProps)(Comp1);
export default Comp;
